const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "understanding-big-o-notation"
    }}>{`Understanding Big-O Notation`}</h1>
    <p><img alt="Big-O Notation" src="https://cdn-media-1.freecodecamp.org/images/0*B42QL_XBJgDGfIFd.jpg" /></p>
    <h2 {...{
      "id": "resources"
    }}>{`Resources`}</h2>
    <ol>
      <li parentName="ol"><a parentName="li" {...{
          "href": "https://en.wikipedia.org/wiki/Big_O_notation"
        }}>{`Wikipedia`}</a></li>
      <li parentName="ol"><a parentName="li" {...{
          "href": "http://carlcheo.com/compsci"
        }}>{`CompSci`}</a></li>
      <li parentName="ol"><a parentName="li" {...{
          "href": "https://www.freecodecamp.org/news/big-o-notation-simply-explained-with-illustrations-and-video-87d5a71c0174/"
        }}>{`Big-O Notation`}</a></li>
      <li parentName="ol"><a parentName="li" {...{
          "href": "https://www.geeksforgeeks.org/time-complexities-of-all-sorting-algorithms/"
        }}>{`Big-O For Sorting Algorithms`}</a></li>
      <li parentName="ol"><a parentName="li" {...{
          "href": "http://sorting.at/"
        }}>{`sorting.at`}</a></li>
      <li parentName="ol"><a parentName="li" {...{
          "href": "https://visualgo.net/bn/sorting"
        }}>{`Visual Go`}</a></li>
    </ol>
    <h2 {...{
      "id": "big-o-notation"
    }}>{`Big-O Notation`}</h2>
    <p>{`Algorithm running times grow at different rates.`}</p>
    <p>{`Big O doesn’t tell you the speed in seconds. Big O notation lets you compare the number of operations. It tells you how fast the algorithm grows and establishes a worst-case run time.`}</p>
    <p>{`A simple search on an array takes O(n) times, whereas a binary search would take O(log n) given the nature of (log`}{`[2]`}{`n).`}</p>
    <h2 {...{
      "id": "common-big-o-times"
    }}>{`Common Big-O Times`}</h2>
    <p>{`Here are five Big O run times that you’ll encounter a lot, sorted from fastest to slowest:`}</p>
    <ol>
      <li parentName="ol"><inlineCode parentName="li">{`O(log n)`}</inlineCode>{`, also known as log time. Example: Binary search.`}</li>
      <li parentName="ol"><inlineCode parentName="li">{`O(n)`}</inlineCode>{`, also known as linear time. Example: Simple search.`}</li>
      <li parentName="ol"><inlineCode parentName="li">{`O(n * log n)`}</inlineCode>{`. Example: A fast sorting algorithm, like quicksort.`}</li>
      <li parentName="ol"><inlineCode parentName="li">{`O(n2)`}</inlineCode>{`. Example: A slow sorting algorithm, like selection sort.`}</li>
      <li parentName="ol"><inlineCode parentName="li">{`O(n!)`}</inlineCode>{`. Example: A really slow algorithm, like the traveling salesperson.`}</li>
    </ol>
    <h2 {...{
      "id": "big-o-time-complexity-from-algorithms"
    }}>{`Big-O Time Complexity from Algorithms`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Algorithm`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Best`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Average`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Worst`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Selection Sort`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Ω(n^2)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`θ(n^2)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`O(n^2)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Bubble Sort`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Ω(n)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`θ(n^2)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`O(n^2)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Insertion Sort`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Ω(n)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`θ(n^2)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`O(n^2)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Heap Sort`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Ω(n log(n))`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`θ(n log(n))`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`O(n log(n))`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Quick Sort`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Ω(n log(n))`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`θ(n log(n))`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`O(n^2)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Merge Sort`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Ω(n log(n))`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`θ(n log(n))`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`O(n log(n))`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Bucket Sort`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Ω(n+k)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`θ(n+k)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`O(n^2)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Radix Sort`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Ω(nk)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`θ(nk)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`O(nk)`}</td>
        </tr>
      </tbody>
    </table>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
